package main

import "sort"

func Minpath(grid [][]int, k int) []int {
	n := len(grid)
	moves := []struct{ x, y int }{
		{-1, 0}, {1, 0}, {0, -1}, {0, 1},
	}

	var dfs func(x, y int, path []int)
	var result []int

	dfs = func(x, y int, path []int) {
		if len(path) == k {
			if result == nil || less(path, result) {
				result = make([]int, k)
				copy(result, path)
			}
			return
		}
		for _, move := range moves {
			newX, newY := x+move.x, y+move.y
			if newX >= 0 && newX < n && newY >= 0 && newY < n {
				dfs(newX, newY, append(path, grid[newX][newY]))
			}
		}
	}

	for i := 0; i < n; i++ {
		for j := 0; j < n; j++ {
			dfs(i, j, []int{grid[i][j]})
		}
	}

	return result
}

func less(a, b []int) bool {
	for i := 0; i < len(a); i++ {
		if a[i] < b[i] {
			return true
		} else if a[i] > b[i] {
			return false
		}
	}
	return false
}

